import 'bootstrap/dist/css/bootstrap.min.css';

function ContactSection() {
    return (
        <div className="contact-section bg-dark text-light py-5" id="contact">
            <div className="container">
                <div className="row">
                    {/* Contact Heading */}
                    <div className="col-md-6">
                        <h1 className="display-4 fw-bold">CONTACT</h1>
                        <hr className="border-2 border-light w-25" />
                    </div>
                </div>
                <div className="row align-items-center mt-4">
                    {/* Left Text Block */}
                    <div className="col-md-6">
                        <h2 className="fw-light">Say <span className="fw-bold">HELLO!</span></h2>
                    </div>
                    {/* Right Contact Links */}
                    <div className="col-md-6 text-md-end">
                        <ul className="list-unstyled">
                            <li><a href="mailto:your-email@example.com" className="text-light fs-4 text-decoration-none">Email</a></li>
                            <li><a href="https://github.com/yourgithub" target="_blank" rel="noopener noreferrer" className="text-light fs-4 text-decoration-none">GitHub</a></li>
                            <li><a href="https://linkedin.com/in/yourlinkedin" target="_blank" rel="noopener noreferrer" className="text-light fs-4 text-decoration-none">LinkedIn</a></li>
                        </ul>
                    </div>
                </div>
            </div>
        </div>
    );
}

export default ContactSection;
